import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"

function RoadLevel6(props) {
    return (
        <div style = {{display:'flex',flexDirection:'column'}}>
            <div style = {{position:'relative', left:'73em', bottom:'24em'}}>
              <Road width={'10em'}
                height= {'3em'}
                StylingInfo = {'vertical-road'}/>
              <Road width={'10em'}
                height= {'10em'}
                StylingInfo = {'vertical-road'}
                dashType = {'vertical-dash'}/>
              <Road width={'10em'}
                height= {'10em'}
                StylingInfo = {'vertical-road1'}/>
              <div style = {{position:'relative', bottom: '10em', right: '75em'}}>
               <Road width={'75em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}/>
              </div>
            </div>
        </div>
    )

}

export default RoadLevel6
